import { lazy, Suspense } from "react";
import { Route, Routes } from "react-router-dom";

const IndexHtml = lazy(() =>
  import("../components/IndexHtml.component").then((m) => ({
    default: m.IndexHtml,
  }))
);

export const RouterLogin = () => (
  <Route
    index
    element={
      <Suspense fallback={<div>Loading...</div>}>
        <IndexHtml />
      </Suspense>
    }
  ></Route>
);
